import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import './suffolkpunch.ttf'
import background from'./background.mp4'
import ScrollContainer from 'react-indiana-drag-scroll'

function Countdown() {

	let countDownDate = new Date("Oct 21, 2022 00:00:00").getTime();

	let x = setInterval(function() {

		let now = new Date().getTime();

		let distance = countDownDate - now;

		let days = Math.floor(distance / (1000 * 60 * 60 * 24));
		let hours = Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
  		let minutes = Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60));
  		let seconds = Math.floor((distance % (1000 * 60)) / 1000);

  		document.getElementById("countdown").innerHTML = "<li className=`inner`>" + days +  " days " + "</li>" + "|" + "<li className=`inner`>" +  hours  +  " hours " + "</li>" + "|" + "<li className=`inner`>" +  minutes + " minutes " + "</li>" + "| " + "<li className=`inner`>" + seconds + " seconds " + "</li>";

  		if (distance < 0) {
  			clearInterval(x);
  			document.getElementById("countdown").innerHTML = "OUT NOW"
  		}

	}, 1000 )

  return ;
}


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>

  	<div className="font-face-gm menu"> 

  		<div className="menu-center">
  			<a href="#">Arctic <br/>Monkeys</a>
  		</div>

  			<a href="#">Store</a>
	 		<a href="#">Live</a>

  		<div className="menu-right">
  			<a href="#">Video</a>
	 		<a href="#">News</a>
	 	</div>

	 </div>

  <video autoPlay muted loop src={background} id="background" />


  <div className="wrapper">
  	<ScrollContainer className="scroll-container">

	 <ul id="countdown">
	  root.render(<Countdown />);
	  </ul>

	</ScrollContainer>
	</div>


  </React.StrictMode>
);
